//	Модел 27151 - Графичен ефект на мъгла
//	П. Бойчев, 2017


// конструктор на модела
MEIRO.Models.M27151 = function M27151(room)
{
	MEIRO.Model.apply(this, arguments);

	var earthMap = new THREE.TextureLoader().load('data:image/jpeg;base64,');
	var moonMap = new THREE.TextureLoader().load('data:image/jpeg;base64,');
	
	earthMap.anisotropy = 0;
	moonMap.anisotropy = 0;

	
	this.image.fog = new THREE.Fog('cornflowerblue',1,2);
	
	var universe = new THREE.Mesh(
		new THREE.IcosahedronGeometry(5,3),
		new THREE.MeshBasicMaterial({side:THREE.BackSide,color:'white'})
	);
	
	this.earth = new THREE.Mesh(
		MEIRO.PRIMITIVE.GEOMETRY.SPHERE,
		new THREE.MeshLambertMaterial({map:earthMap,fog:false})
	);
	this.earth.scale.set(1.5,1.5,1.5);
	
	this.moon = [];
	var material = new THREE.MeshLambertMaterial({map:moonMap});
	for (var i=0; i<6; i++)
	{
		this.moon.push( new THREE.Mesh(
			MEIRO.PRIMITIVE.GEOMETRY.SPHERE,
			material
		));
		this.moon[i].scale.set(1/3,1/3,1/3);
	}
	
	// сглобяване на целия модел
	this.image.add(this.earth,universe);
	for (var i=0; i<6; i++)
		this.image.add(this.moon[i]);
}

MEIRO.Models.M27151.prototype = Object.create(MEIRO.Model.prototype);

MEIRO.Models.M27151.DIST = {MIN:5, MAX:20, HEIGHT:0};
MEIRO.Models.M27151.POS = {DIST:10, ROT_X:0.5, ROT_Y:0.3};
MEIRO.Models.M27151.ROT_Y = {MIN:-0.1, MAX:0.7};


// аниматор на модела
MEIRO.Models.M27151.prototype.onAnimate = function(time)
{
	if (controls.dist)
	{	
		this.image.fog.near = controls.dist-0.4;
		this.image.fog.far = controls.dist+0.4;
	}
	else
	{	
		this.image.fog.near = 100;
		this.image.fog.far = 1000;
	}
	
	this.earth.rotation.y = rpm(time,10);

	for (var i=0; i<6; i++)
		this.moon[i].rotation.y = rpm(time,10);
		
	var a = rpm(time,12);
	var s = Math.sin(a)
	var c = Math.cos(a);
	
	this.moon[0].position.set(4*s,0,4*c);
	this.moon[1].position.set(-4*s,0,-4*c);
	
	this.moon[2].position.set(4*c,2.5*s,0);
	this.moon[3].position.set(-4*c,-2.5*s,0);
	
	this.moon[4].position.set(0,2.5*c,4*s);
	this.moon[5].position.set(0,-2.5*c,-4*s);
	
	reanimate();
}



// информатор на модела
MEIRO.Models.M27151.prototype.onInfo = function(element)
{
	var s = '';
	s += '<h1>Графичен ефект на мъгла</h1>';

	s += '<p>Ефектът на мъглата променя цвета на обектите според разстоянието им до зрителя. Колкото по-отдалечен е обект, толкова по-замъглен се изобразява &ndash; неговите цветове приемат цвета на мъглата.</p>';
	
	element.innerHTML = s;
}